   
from collections import deque

class Solution:
    def canReach(self, arr, start):
        queue = deque([start])
        visited = set()

        while queue:
            current = queue.popleft()

            # If the value at the current index is zero, return True
            if arr[current] == 0:
                return True

            # Mark the current index as visited
            visited.add(current)

            # Compute the forward and backward jumps
            forward = current + arr[current]
            backward = current - arr[current]

            # Enqueue valid and unvisited positions
            if forward < len(arr) and forward not in visited:
                queue.append(forward)
            if backward >= 0 and backward not in visited:
                queue.append(backward)

        # If no zero value is reached
        return False

    
    def canReach2(self, arr, start): #time limit exceeds for that looong arr
        """
        :type arr: List[int]
        :type start: int
        :rtype: bool
        """
        visited = []
        def reach(arr, pos):
            if pos < 0 or pos >= len(arr) or pos in visited:
                return False
            visited.append(pos)
            val = arr[pos]
            if val == 0:
                return True
            return reach(arr, pos - val) or reach(arr, pos + val)
           
        return reach(arr, start)


